import React from "react";


const Projects =  () => {
    return(
        <>
        <h1 className="tc white">Projects</h1>
        <div className="project_1">
        <h2 className="white">Project Title </h2>
        <p className="white">This project marks my first attempt at Python programming. I have utilized a pre-existing library to enable video downloads via provided links. The implementation features a user-friendly Graphical User Interface (GUI) that allows users to choose a folder for downloading or playing music. Users can opt to either directly download MP3 files to the selected folder or play music already present in the folder with the ".mp3" extension. While I had initially planned to add more features and improve the GUI, I have decided to set those plans aside for now to focus on other projects.</p>
        <br />
        <p><a>Link to </a></p>
        </div>
        </>
    )
}

export default Projects;
